import React from 'react';
import logo from './logo.svg';
import './App.css';
import './Navbar';

export default class ProductPage extends React.Component{
    render(){
        return(
            <div>
                <div class="border rounded" id="photo-frame">
                <img src={logo}  alt="..."></img>

                </div>
            </div>
        )
    }
}
